script: |
  super -f text -I q8121.spq | sort > q8121.out

inputs:
  - name: q8121.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) cor0 WHERE NOT NULL NOT BETWEEN ( - 65 ) AND 81 * + - col2 * 16 OR + col0 + col2 IS NOT NULL;
  - name: tab1

outputs:
  - name: q8121.out
    data: |
      51	14	96
      85	5	59
      91	47	68
